import React from 'react';
import './App.css';

import Search from './components/Search';

function App() {
  return (
    <div className="App">
      <nav className="App-nav">
        <div>Git Scrape</div>
        <div>View on Github</div>
      </nav>
      <div className="content">
        <SearchBar />
      </div>
    </div>
  );
}

export default App;
